import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FaPhone, FaEnvelope, FaMapMarkerAlt } from 'react-icons/fa';
import { Link } from 'react-router-dom';

const RecentActivityTable = ({ recentCalls }) => {
  return (
    <div className="mt-8 bg-white shadow-lg rounded-lg p-6">
      <h2 className="text-xl font-bold mb-4">Recent Call Logs</h2>
      <table className="min-w-full table-auto">
        <thead>
          <tr>
            <th className="px-4 py-2 text-left text-gray-600">Caller</th>
            <th className="px-4 py-2 text-left text-gray-600">Time</th>
            <th className="px-4 py-2 text-left text-gray-600">Duration</th>
            <th className="px-4 py-2 text-left text-gray-600">Status</th>
          </tr>
        </thead>
        <tbody>
          {recentCalls.map((call, index) => (
            <tr key={index} className="hover:bg-gray-100">
              <td className="border px-4 py-2">{call.callDetails.number}</td>
              <td className="border px-4 py-2">{new Date(call.timestamp).toLocaleTimeString()}</td>
              <td className="border px-4 py-2">{call.callDetails.duration}</td>
              <td className={`border px-4 py-2 ${call.callDetails.status === 'Completed' ? 'text-green-500' : 'text-red-500'}`}>
                {call.callDetails.status}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const Dashboard = () => {
  const [totalCalls, setTotalCalls] = useState(0);
  const [totalMessages, setTotalMessages] = useState(0);
  const [recentCalls, setRecentCalls] = useState([]);

  // Fetch data from the backend
  useEffect(() => {
    const fetchData = async () => {
      try {
        // Fetch call logs
        const callResponse = await axios.get('http://localhost:3005/getcall-log');
        setTotalCalls(callResponse.data.length); // Total number of calls
        setRecentCalls(callResponse.data.slice(-2).reverse()); // Recent two calls

        // Fetch messages
        const messageResponse = await axios.get('http://localhost:3005/getmessages');
        setTotalMessages(messageResponse.data.length); // Total number of messages

      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="p-4">
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        {/* Cards */}
        <div className="bg-white shadow-lg rounded-lg p-6 flex items-center justify-between hover:shadow-xl transition-shadow">
          <div>
            <h2 className="text-2xl font-bold">Total Calls</h2>
            <p className="text-gray-500 mt-1">{totalCalls} calls</p>
          </div>
          <FaPhone className="text-blue-500 text-3xl" />
        </div>
        <div className="bg-white shadow-lg rounded-lg p-6 flex items-center justify-between hover:shadow-xl transition-shadow">
          <div>
            <h2 className="text-2xl font-bold">Messages</h2>
            <p className="text-gray-500 mt-1">{totalMessages} messages</p>
          </div>
          <FaEnvelope className="text-green-500 text-3xl" />
        </div>
        <div className="bg-white shadow-lg rounded-lg p-6 flex items-center justify-between hover:shadow-xl transition-shadow">
          <div>
            <h2 className="text-2xl font-bold">Location Updates</h2>
            <p className="text-gray-500 mt-1">50 updates</p> {/* Hardcoded for now */}
          </div>
          <FaMapMarkerAlt className="text-red-500 text-3xl" />
        </div>
      </div>

      {/* Recent Activity Table */}
      <RecentActivityTable recentCalls={recentCalls} />
    </div>
  );
};

export default Dashboard;
